import React, { useState } from 'react';
import './split.scss'; // SCSS 파일 가져오기

function DoubleRangeSlider() {
  const [rangeValues, setRangeValues] = useState([0, 10]);

  const handleChange = (event, newValue) => {
    setRangeValues(newValue);
  };

  return (
    <div className="double-range-slider">
      <span>
        범위: {rangeValues[0]} - {rangeValues[1]}
      </span>
      <div className="split-slider">
        <input
          type="range"
          min={1}
          max={9}
          step={1}
          value={rangeValues[0]}
          onChange={(e) =>
            handleChange(e, [parseInt(e.target.value), rangeValues[1]])
          }
        />
        <input
          type="range"
          min={2}
          max={10}
          step={1}
          value={rangeValues[1]}
          onChange={(e) =>
            handleChange(e, [rangeValues[0], parseInt(e.target.value)])
          }
        />
      </div>
    </div>
  );
}

export default DoubleRangeSlider;
